import React, { Fragment } from 'react';
import './App.css';
import WeatherCardRow from './Seven Hour Forecast/sevenHour';
import CityBox from './City Box/cityBox';
import Banner from './Banner/banner';
import SideMenu from './Side Menu/SideMenu';

function App() {
    return (
        <Fragment>
            <SideMenu />
            <CityBox 
                city={"Houston"}
            />
            <Banner />
            <WeatherCardRow />
        </Fragment>
    );
}

export default App;
